--------------------------------------------------------- Hook Tukui slash commands-------------------------------------------------------local SlashCmdList_TUKUIHEAL_ = SlashCmdList.TUKUIHEAL -- save old functionfunction SlashCmdList:TUKUIHEAL()	--print("oUF_Healium /heal hooked function")	DisableAddOn("Tukui_Raid")	DisableAddOn("Tukui_Raid_Healing")	EnableAddOn("Healium_Core")	EnableAddOn("Healium_Tukui")	ReloadUI()endlocal SlashCmdList_TUKUIDPS_ = SlashCmdList.TUKUIDPS -- save old functionfunction SlashCmdList:TUKUIDPS()	--print("oUF_Healium /dps hooked function")	DisableAddOn("Tukui_Raid_Healing")	DisableAddOn("Healium_Core")	DisableAddOn("Healium_Tukui")	EnableAddOn("Tukui_Raid")	ReloadUI()end